responses.body:
[
  {{#repeat 2 10}}
  {
    "id": {{faker 'number.int' max=99999}},
    "title": "{{oneOf (array 'Contract review' 'VAT compliance' 'ZTAR account status' 'MVNA onboarding checklist' 'PEAK data eligibility' 'Entity verification' 'Registration update')}}",
    "comment": "{{oneOf (array 'Pending legal teams confirmation if current MVNA contracts under ZTAR are valid for PEAK Data onboarding.' 'Awaiting response from finance team (Sashidhar/John) regarding VAT registration eligibility under ZTAR for PEAK Data.' 'Need confirmation from John/Sashidhar if ZTAR account setup meets PEAKs MVNA qualification criteria.' 'Review pending with Sashidhar on whether all onboarding items, including tax documents under ZTAR, are complete for PEAK.' 'Awaiting validation from John if current ZTAR setup fulfills the PEAK Data compliance requirements.' 'Pending internal confirmation from Sashidhar on whether ZTAR qualifies as a valid entity for PEAK as MVNA.' 'Follow-up required with John/Sashidhar to confirm if latest TAX registrations under ZTAR are aligned with PEAK onboarding needs')}}",
    "status": "{{faker 'helpers.arrayElement' (array 'Completed' 'Resolution Required' 'In Progress' 'Awaiting completion' 'Pending')}}",
    "updatedDate": "{{dateFormat (faker 'date.recent' days=5) "yyyy-MM-dd'T'HH:mm:ss.SSS'Z'"}}",
    "updatedBy": "{{{faker 'person.firstName'}}} {{{faker 'person.lastName'}}}",
    "createdDate": "{{dateFormat (faker 'date.recent' days=365) "yyyy-MM-dd'T'HH:mm:ss.SSS'Z'"}}",
    "createdBy": "{{{faker 'person.firstName'}}} {{{faker 'person.lastName'}}}"
  }
  {{/repeat}}
]

[
   {{#repeat 5 20}}
  {
    "id": {{faker 'number.int' max=99999}},
    "field": "{{oneOf (array 'Department Code' 'Employee Id' 'Project Code' 'Location Code' 'Approval Status')}}",
    "previousValue": "{{oneOf (array 'Resolution Required' 'In Progress' 'Awaiting completion' 'Pending')}}",
    "newValue": "{{oneOf (array 'Resolved' 'Completed' 'Closed' 'Tested')}}",
    "updatedDate": "{{dateFormat (faker 'date.recent' days=5) "yyyy-MM-dd'T'HH:mm:ss.SSS'Z'"}}",
    "updatedBy": "{{{faker 'person.firstName'}}} {{{faker 'person.lastName'}}} {{faker 'person.lastName'}}"
  }
  {{/repeat}}
]
